import React, { Component } from 'react';

class TodoList extends Component{


	render(){
		return (
			<div className="mt-5">
				<ul className="list-group">
					{this.props.items.map((item) =>
						<div>
							<li key={item} className="list-group-item" style={{display: 'flex', justifyContent: "space-between"}}>
								{item}
								<a href='#'>Delete</a>
							</li>
						</div>
					)}
				</ul>
			</div>
		);
	}
};

export default TodoList;
